import React from "react";
// import { Link } from "react-router-dom";


const GeminiHome = ({ authUser }) => {
  return (
    <div className="container">  
      <div className="hero-section">
        <div>
          <h1 className="display-3 fw-bold">Welcome to Gemini5</h1>
          <p>Discover the future with our cutting-edge platform.</p>
          {/* <Link className="button-start" to="/signup">Get Started</Link> */}
        </div>
      </div>
    </div>
  );
};

export default GeminiHome;
